import './App.css';

function App() {
  const val = "Welcome to the blog";
  const likes = 50;
  const objperson = {name: "Arpit", age: 23, }
  return (
    <div className="App">
      <div className='content'>
        <h1>{val}</h1>
        <p>Liked {likes} times!</p>
      </div>
    </div>
  );
}

export default App;
